package com.jiagouedu.services.front.questionnaire.impl;import com.jiagouedu.core.ServersManager;import com.jiagouedu.services.front.questionnaire.QuestionnaireService;import com.jiagouedu.services.front.questionnaire.bean.Questionnaire;import com.jiagouedu.services.front.questionnaire.dao.QuestionnaireDao;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import javax.annotation.Resource;@Servicepublic class QuestionnaireServiceImpl extends ServersManager<Questionnaire, QuestionnaireDao>		implements QuestionnaireService {    @Resource(name = "questionnaireDao")    @Override    public void setDao(QuestionnaireDao questionnaireDao) {        this.dao = questionnaireDao;    }	/**	 * 新增问卷	 */	@Override	public int insert(Questionnaire e) {		if(e==null){			throw new NullPointerException("e is null");		}						return super.insert(e);	}	/**	 * 修改问卷	 */	@Override	public int update(Questionnaire e) {				return super.update(e);	}}